function deleteUser(){const n=$("#userId").val();Swal.fire({title:"Emin misiniz?",text:"Bu kayıt kalıcı olarak silinecektir!",icon:"warning",showCancelButton:!0,confirmButtonColor:"#c70039",cancelButtonColor:"#6c757d",confirmButtonText:"Sil",cancelButtonText:"Vazgeç"}).then(t=>{t.value&&$.ajax({dataType:"json",type:"POST",url:"/User/Delete",data:{id:n},success:function(n){n.isSuccess===!0?redirectToWindowLocation(n.redirectUrl):n.message!==null?SweetAlertError(n.message):SweetAlertError()},error:function(n){console.log(n);SweetAlertError()}})})}function redirectToWindowLocation(n){window.location.href=n}function SweetAlertError(){Swal.fire("İşlem başarısız!","Bir hata oluştu. Lütfen daha sonra tekrar deneyiniz.","warning")}function SweetAlertError(n){Swal.fire("İşlem başarısız!",n,"warning")}$("#deleteUser").on("click",()=>{deleteUser()});